  Code = "class Solution:\n    def lastVisitedIntegers(self, nums: List[int]) -> List[int]:\n        enc = []\n        res = []\n        m1_cnt = 0\n        for num in nums:\n            if num != -1:\n                m1_cnt = 0\n                enc.append(num)\n                continue\n            m1_cnt += 1\n            if m1_cnt <= len(enc):\n                res.append(enc[len(enc) - (m1_cnt - 1) - 1])\n            else:\n                res.append(-1)\n        return res"
